import React from "react";
import "./BannerTitle.scss"; // Assurez-vous d'importer le SCSS

const BannerTitleContent = ({ numItem, numTranslate }) => {
    return (
        <div className={`bannerTitleContent ${numItem} ${numTranslate}`}>
            <span></span>
            <p>Son</p>
        </div>
    );
};

const BannerTitle = ({ numTranslate }) => {
    return (
        <div className="bannerTitle">
            {Array.from({ length: 8 }, (_, i) => (
                <BannerTitleContent
                    key={i}
                    numItem={`item${i + 1}`}
                    numTranslate={numTranslate}
                />
            ))}
        </div>
    );
};

export default BannerTitle;
